/*****************************************************************************
 * Function Name  : determineUlTBSize 
 * Inputs         : mcsIndex - modulation coding scheme index,
 *                  nbRB - number of resource block assigned
 * Outputs        : Transport Block Size
 * Returns        : tbSize
 * Description    : This function returns the transport block size according to
                    mcsIndex and number of RB for UPLINK transmision.
 *****************************************************************************/
UInt32 determineUlTBSize(UInt32 mcsIndex, UInt32 nbRB)
{
    UInt8 ibsIndex = 0;
    UInt32 tbSize = 0;
    ibsIndex = TBSUlArr[mcsIndex];
    /* Coverity 31422_73450 Fix Start */
    if(nbRB)
    {
        tbSize = TBSizeArr[ibsIndex][nbRB - 1];
    }
    else
    {
        tbSize = TBSizeArr[ibsIndex][nbRB];
    }
    /* Coverity 31422_73450 Fix End */
    /* 4x4 DL MIMO CHG START */
    return tbSize;
    /* 4x4 DL MIMO CHG END */
}
/*  SPR 1868 */


/*****************************************************************************
 * Function Name  : determineTBSize 
 * Inputs         : mcsIndex - modulation coding scheme index,
 *                  nbRB - number of resource block assigned,
 *                  tbMappedToLayerNum - num of layer tb has been mapped.
 * Outputs        : Transport Block Size
 * Returns        : tbSize
 * Description    : This function returns the transport block size according to
                    mcsIndex and number of RB.
 *****************************************************************************/
 UInt32 determineTBSize( UInt32 mcsIndex,
                               UInt32 nbRB,
                               UInt8  tbMappedToLayerNum )
{
    UInt8  ibsIndex = 0;
    UInt32 tbSize   = 0;

               /* SPR 20430 Changes Start  */
    if (nbRB == 0 || nbRB > 109)
    {
      /* If this situation occurs during race condition then L2 should not Crash */
      return tbSize;
    }
               /* SPR 20430 Changes End  */
    ibsIndex = TBSArr[mcsIndex];   
    /*4x4 DL MIMO CHG START*/
    /* Coverity 73546 Fix Start*/
    if (TB_MAPPED_TO_TWO_LAYER == tbMappedToLayerNum)
    {
            /*SPR 20430: CID 107970 Changes Start*/
            tbSize = TBSizeArrL2[ibsIndex][nbRB - 1];
            /*SPR 20430: CID 107970 Changes End*/
    }
    else
    {
            /*SPR 20430: CID 107970 Changes Start*/
            tbSize = TBSizeArr[ibsIndex][nbRB - 1];
            /*SPR 20430: CID 107970 Changes End*/
    }
    /* Coverity 73546 Fix End*/
    /*4x4 DL MIMO CHG END*/
    return tbSize;
}
