/*****************************************************************************
 * Function Name  : fillRBSelectionTableforDCIFormat1A
 * Inputs         : msg_p - Pointer to data pointer,
 *                  mapLength- Length of the message in bytes,
 *                  dlResBlocks,
 *                  cellParams_p
 * Outputs        : None
 * Returns        : mapCount - value
 * Description    : This function fill the Vendor specific RB Table.
 *****************************************************************************/
UInt8 fillRBSelectionTableforDCIFormat1A(UInt8 **msg_p, UInt8 mapLength,
                                         /* +- SPR 17777 */
                                         CellConfigParams *cellParams_p)
/* CA Changes end */ 
{
    UInt8 mapCount = 0;
    UInt8 *data_p = PNULL;

    data_p  = *msg_p;

	/* + Coverity 73056 */
    if ( mapLength > 0 )
	{
    	for(; mapCount < mapLength;mapCount++)
    	{
            /* +- SPR 17777 */
        	/* CA Changes start */ 
        	cellParams_p->RBSelectionTableDCI1A[mapCount] = *data_p;
        	/* Review comment fix start SYNC_LOSS_2*/
        	LOG_MAC_MSG(MAC_RBS_FOR_DCI_1A_PARAM,LOGINFO,MAC_RRC_INF,
                	getCurrentTick(),
                	cellParams_p->RBSelectionTableDCI1A[mapCount], 
                	mapCount, 
                	DEFAULT_INT_VALUE, 
                	DEFAULT_INT_VALUE, 
                	DEFAULT_INT_VALUE, 
                	DEFAULT_FLOAT_VALUE, DEFAULT_FLOAT_VALUE,
                	FUNCTION_NAME, "MAC_RBS_FOR_DCI_1A_PARAM");
        	/* Review comment fix end SYNC_LOSS_2*/
        	/* CA Changes end */ 
        	data_p += 1;
    	}
	}
	/* - Coverity 73056 */

    *msg_p = data_p;
    return mapCount;
}

/*****************************************************************************
 * Function Name  : fillRBSelectionTableforDCIFormat1C
 * Inputs         : msg_p - Pointer to data pointer,
 *                  mapLength- Length of the message in bytes
 *                  cellParams_p
 * Returns        : mapCount - value
 * Description    : This function fill the Vendor specific RB Table.
 *****************************************************************************/
/* CA Changes start */ 
UInt8 fillRBSelectionTableforDCIFormat1C(UInt8 **msg_p, UInt8 mapLength,
                                         CellConfigParams *cellParams_p)
/* CA Changes end */ 
{
    UInt8 mapCount = 0;
    UInt8 *data_p = PNULL;

    UInt8 nRBStep = 0;

    /*
     * For DCI_Format 1C according to Table 7.1.6.3-1 in spec 36.213
     */
    /* ICIC changes start */
    nRBStep = (((cellParams_p->dlAvailableRBs >= 6)&&
                (cellParams_p->dlAvailableRBs <= 49))?2:4);
    /* ICIC changes end */

    data_p  = *msg_p;

	/* + Coverity 72904 */
	if ( mapLength)
    for(; mapCount < mapLength;mapCount++)
    {

        /*
         *  According to 7.1.6.3 for DCI_format_1C
         *  length of reseoucre blocks in following
         * (nRBStep,2nRBStep,3nRBStep,.......)
         */

        if((!(*data_p)) || ((*data_p) % nRBStep))
        {
            return 0;
        }

       /* CA Changes start */ 
       cellParams_p->RBSelectionTableDCI1C[mapCount] = *data_p;
        /* Review comment fix start SYNC_LOSS_2*/
        LOG_MAC_MSG(MAC_RBS_FOR_DCI_1C_PARAM,LOGINFO,MAC_RRC_INF,
                getCurrentTick(),
                cellParams_p->RBSelectionTableDCI1C[mapCount], 
                mapCount, 
                DEFAULT_INT_VALUE, 
                DEFAULT_INT_VALUE, 
                DEFAULT_INT_VALUE, 
                DEFAULT_FLOAT_VALUE, DEFAULT_FLOAT_VALUE,
                FUNCTION_NAME, "MAC_RBS_FOR_DCI_1C_PARAM");
        /* Review comment fix end SYNC_LOSS_2*/
       /* CA Changes end */ 

        data_p += 1;
    }

    *msg_p = data_p;
    return mapCount;
}

