/* SPR 3062 Chg Ends*/
/*****************************************************************************
 * Function Name  : determineRBs
 * Inputs         : mcsIndex - modulation coding scheme index,
 *                  dataSize_p - Block Size in Bytes,
 *                  value - indicates need to determine RBs
 *                          for DL/UL allocation
 *                  internalCellIndex - Cell-Index at MAC
 * Outputs        : None
 * Returns        : nbRB - number of resource block assigned
 * Description    : This function returns the number of RB according to the
 transport block size and mcsIndex .
 *****************************************************************************/
UInt32 determineRBs(UInt32 mcsIndex, UInt32 *dataSize_p, 
                    /* SPR 5999 changes start */
                    UInt8 value,
                    /*CA Changes start  */
                    InternalCellIndex internalCellIndex)
                    /*CA Changes end  */
                    /* SPR 5999 changes end */
{
    SInt8 ibs_idx = 0;
    /* Binary lookup */
    UInt8 low, mid, high;
    /*4x4 DL MIMO CHG START*/
    UInt32 tempDataSize = *dataSize_p;
    /*4X4 DL MIMO CHG END*/
    UInt32 localDataSize = *dataSize_p;
    /* 4x4 DL MIMO CHG START */
    UInt32 tbSizeHigh = 0;
    UInt32 tbSizeLow = 0;
    UInt32 tbSizeMid = 0;
    UInt32 tbSizeMidLessThanOne = 0;
    /* 4x4 DL MIMO CHG END */

    LTE_MAC_UT_LOG(LOG_DETAIL,TB_SIZE,"determineRBs  mcsIndex = %d and \
        dataSize_p = %d",mcsIndex,MULTIPLY_BY_EIGHT(tempDataSize));

    low = 0;
    /*CA Changes start  */
    high = cellSpecificParams_g.cellConfigAndInitParams_p[internalCellIndex]->cellParams_p->dlAvailableRBs- 1;
    /*CA Changes end  */
    /* SPR 5999 changes start */
    if(DL_ALLOCATION == value)
    {
        ibs_idx = TBSArr[mcsIndex];
    }
    else if(UL_ALLOCATION == value)
    {
        ibs_idx = TBSUlArr[mcsIndex];
    }
    /* SPR 5999 changes end */

    /* SPR#706 Changes Start */
    if((ibs_idx < 0)||(ibs_idx >= MAX_IBS_INDEX_DCI_1A))
    {
     ltePanic(" Corrupted Tabled Definition in %s",__func__);
	 /* + Coveirty 10161 */
	 return 0 ;
	 /* - Coveirty 10161 */
    }
    /* SPR#706 Changes End */
   
    /* SPR 1765 changes start */ 
    /*
     * we should allocate max RBs if temp datasize is more than max allowed.   
     */
    /* 4x4 DL MIMO CHG START */
    	tbSizeHigh = TBSizeArr[ibs_idx][high]; 
    	tbSizeLow  = TBSizeArr[ibs_idx][low]; 
    

    if(tbSizeHigh < tempDataSize)
    {
        *dataSize_p = TBSizeArr[ibs_idx][high];
        LTE_MAC_UT_LOG (LOG_DETAIL,TB_SIZE, " \n dataSize_p = %d", *dataSize_p);
        LTE_MAC_UT_LOG(LOG_DETAIL,TB_SIZE, " \n RB = %d", high + 1);
        return (high + 1);
    }
    //we cannot allocate less than 1 RB   
    else if(tbSizeLow >= tempDataSize)
    /* SPR 1765 changes end */ 
    {
        LTE_MAC_UT_LOG(LOG_DETAIL,TB_SIZE, " \nAllocating minimum i.e 1 RB");
       // localDataSize = TBSizeArr[ibs_idx][low] >> 3;
        localDataSize = TBSizeArr[ibs_idx][low];
                        
        LTE_MAC_UT_LOG(LOG_DETAIL,TB_SIZE, "\n ibs_idx = %d", ibs_idx);
        LTE_MAC_UT_LOG(LOG_DETAIL,TB_SIZE, " \n dataSize_p = %d", localDataSize);
        LTE_MAC_UT_LOG(LOG_DETAIL,TB_SIZE, " \n RB = %d \n", (low + 1));
        *dataSize_p = localDataSize;
        return (low + 1);
    }
    while( low <= high )
    {
        /* Coverity 73273_73499_73310_73443_73315 Fix Start */
        if(low == high)
        {
            *dataSize_p = TBSizeArr[ibs_idx][low];
            return (low + 1);
        }
        /* Coverity 73273_73499_73310_73443_73315 Fix End */

        /*SPR 20899 Fix Start */
        mid = DIVIDE_BY_TWO(low + high);
        /*SPR 20899 Fix Stop*/
        tbSizeMid = TBSizeArr[ibs_idx][mid];
        if(tbSizeMid < tempDataSize)
        {
            low = mid + 1;    
        }
        else if(tbSizeMid > tempDataSize)
        {
            /* + Coverity 10161 */
            if ( mid >= 1 && mid < MAX_RESOURCE_BLOCK )
            /* - Coverity 10161 */
            tbSizeMidLessThanOne = TBSizeArr[ibs_idx][mid - 1];
            if(tbSizeMidLessThanOne < tempDataSize)
            {
                localDataSize = TBSizeArr[ibs_idx][mid];
                LTE_MAC_UT_LOG (LOG_DETAIL,TB_SIZE, " \n dataSize_p = %d", localDataSize);
                LTE_MAC_UT_LOG(LOG_DETAIL,TB_SIZE, " \n RB = %d", mid + 1);
                *dataSize_p = localDataSize;
                return (mid + 1);
            }
            else if(tbSizeMidLessThanOne == tempDataSize)
            {
                /*since each sub-table has multiple enteries with the same TB Size
                 *  so find the first entry with this TB Size*/
                /* + Coverity 10161 */
                if ( mid >= 1 && mid < MAX_RESOURCE_BLOCK )
                /* - Coverity 10161 */
                localDataSize = TBSizeArr[ibs_idx][mid - 1];
    
                --mid;
                /* + Coverity 10161 */
                if ( mid >= 1 && mid < MAX_RESOURCE_BLOCK )
                /* - Coverity 10161 */
                tbSizeMidLessThanOne = TBSizeArr[ibs_idx][mid - 1]; 
                while((tbSizeMidLessThanOne == localDataSize) && (mid > low))
                {
                    --mid;
                    /* + Coverity 10161 */
                    if ( mid >= 1 && mid < MAX_RESOURCE_BLOCK )
                    /* - Coverity 10161 */
                    tbSizeMidLessThanOne = TBSizeArr[ibs_idx][mid - 1];
                }
    
                if ( tempDataSize > localDataSize)
                {
                    /* Coverity 10161 Fix Start */
                    /* Code removed */
                    /* Coverity 10161 Fix End */
                    ltePanic("mcsIndex = %d tempDataSize = %d \n \
                        localDataSize = %d ",
                        mcsIndex,MULTIPLY_BY_EIGHT(tempDataSize),MULTIPLY_BY_EIGHT(localDataSize));
                }                
                LTE_MAC_UT_LOG(LOG_DETAIL,TB_SIZE, " \n dataSize_p = %d", localDataSize);
                LTE_MAC_UT_LOG(LOG_DETAIL,TB_SIZE, " \n RB = %d", mid + 1);
                *dataSize_p = localDataSize;
                return (mid + 1);
            }
            else
            {
                high = mid - 1;
            }
        }
        else if(tbSizeMid == tempDataSize)
        {
            //Take care of the case where THIS infact is THE size we are looking for  
            /* + Coverity 10161 */
            if ( mid >= 1 && mid < MAX_RESOURCE_BLOCK )
            /* - Coverity 10161 */
            tbSizeMidLessThanOne = TBSizeArr[ibs_idx][mid - 1];
            while((tbSizeMidLessThanOne == tempDataSize) && (mid > low))
            {
                --mid;
                /* + Coverity 10161 */
                if ( mid >= 1 && mid < MAX_RESOURCE_BLOCK )
                /* - Coverity 10161 */
                tbSizeMidLessThanOne = TBSizeArr[ibs_idx][mid - 1];
            }
    
            localDataSize = tempDataSize;    
            LTE_MAC_UT_LOG(LOG_DETAIL,TB_SIZE, " \n dataSize_p = %d", localDataSize);
            LTE_MAC_UT_LOG(LOG_DETAIL,TB_SIZE, " \n RB = %d", mid + 1);
            *dataSize_p = localDataSize;
            return (mid + 1);
        }
        /*4x4 DL MIMO CHG END*/
    }
    /* Coverity 73273_73499_73310_73443_73315 Fix Start */
    if(low > high )
    {
        *dataSize_p = TBSizeArr[ibs_idx][low];
        return (low + 1);
    }
    /* Coverity 73273_73499_73310_73443_73315 Fix End */

    LTE_MAC_UT_LOG(LOG_DETAIL,TB_SIZE,  
        "\n Required Tb Size if not available .Hence Returing RB =0 \n");
    return 0;
}





