/*****************************************************************************
 * Function Name  : calculateMaxMcsRbInfoForRat0WithLastRBGSpatialMultiplex
 * Inputs         : rbCounter - number Of allocated Resource Blocks,
 *                  cfiValueIndex - cfi Value,
 *                  mcsIndexForTbOne - allocated Mcs for TB One,
 *                  mcsIndexForTbTwo - allocated Mcs for TB Two,
 *                  maxNumberOfCodedBitsMap_p - Pointer to array which contains
 *                                              maximum Bits which can be coded 
 *                                              below max code rate value
 *                  internalCellIndex - Cell-Index at MAC
 * Outputs        : None
 * Returns        : None
 * Description    : This function will find the maximum possible MCS for 
 *                  TB One and TB Two and RB value below Code Rate 
 *                  and for each UE Category in RAT0.
 *****************************************************************************/
void calculateMaxMcsRbInfoForRat0WithLastRBGSpatialMultiplex(UInt8 rbCounter,
                             /* +- SPR 17777 */
                             UInt8 cfiValueIndex,
                             UInt8 mcsIndexForTbOne,
                             UInt8 mcsIndexForTbTwo,
			     UInt32 (*maxNumberOfCodedBitsMap_p)[MAX_MOD_SCHEME][MAX_NUM_OF_RB][MAX_NUM_OVERLAPPING_RB],
                 InternalCellIndex internalCellIndex)
{
    UInt8 rbgSize = (dlRAInfo_gp[internalCellIndex] + dlRAInfoIndex_g[internalCellIndex])->raPolicyInfo.rat0Info.rbgSize;
    UInt8 maxAllocatedRB = 0;
    UInt8 minRbThresholdValue = 0;
    UInt8 tempRbIndex = 0;
    UInt8 itbsIndex = 0;
    UInt8 minMcsValue = 0;
    UInt8 maxMcsValue = 0;
    /* + Coverity 32411, 32410 */
    /* UInt8 initialMaxMcsValue = 0; */
    /* + Coverity 32411, 32410 */ 
    UInt8 initialMinMcsValue = 0;
    UInt8 maxMcsForMaxTbBitsByMaxMcsReduction = 0;
    UInt8 minMcsForMaxTbBitsByMaxMcsReduction = 0;
    UInt8 allocatedRbForMaxTbBitsByMaxMcsReduction = 0;
    UInt8 maxMcsForMaxTbBitsByMinMcsReduction = 0;
    UInt8 minMcsForMaxTbBitsByMinMcsReduction = 0;
    UInt8 allocatedRbForMaxTbBitsByMinMcsReduction = 0;
    UInt8 maxMcsForMaxTbBitsByRbReduction = 0;
    UInt8 minMcsForMaxTbBitsByRbReduction = 0;
    UInt8 maxMcsForMinMcs = 0;
    UInt8 allocatedRbForMaxTbBitsByRbReduction = 0;
    UInt8 maxMcsForMaxTbBits = 0;
    UInt8 minMcsForMaxTbBits = 0;
    UInt8 allocatedRbForMaxTbBits = 0;
    UInt8 minMcsMaxMcsRbCombinationSuccess = 0;
    UInt8 ueCategoryIndex = 0;
    UInt8 modScheme = 0;
    SInt8 mcsIndex = 0;
    /** CA-TDD Changes Start **/
    static UInt8 rbIndexLeastMultipleOfRbgSize[MAX_NUM_CELL] = {0};
    /** CA-TDD Changes Stop **/
    UInt8 sizeOfLastRbg = (cellSpecificParams_g.cellConfigAndInitParams_p\
            [internalCellIndex]->cellParams_p->dlAvailableRBs % rbgSize);
    UInt8 rbDecrementFactor = 0;
    UInt8 initialDecrementFactor = 0;
    UInt16 numOfCodeBlock = 0;
    UInt32 initialMinTbSize = 0;
    UInt32 crcBits = 0;
    UInt32 initialMaxTbSize = 0;
    UInt32 minTbSize = 0;
    UInt32 maxTbSize = 0;
    UInt32 tbSize = 0;
    UInt32 maxTbSizeForMinMcs = 0;
    UInt32 tbSizeForMaxTbBitsByMaxMcsReduction = 0;
    UInt32 tbSizeForMaxTbBitsByMinMcsReduction = 0;
    UInt32 tbSizeForMaxTbBitsByRbReduction = 0;
    UInt32 tbSizeForMaxTbBits = 0;
    UInt32 maxDLSCHTbBits = 0;
    UInt32 maxBitsDLSCHTb = 0;
    UInt32 maxNumberOfCodedBits = 0;
    McsRBInfoForNonSpatialMultiplex (*mcsRBInfo_p)[MAX_UE_CATEGORY][MAX_NUM_OF_RB] = PNULL;
    McsRBInfoForNonSpatialMultiplex *mcsRBInfoForNonSpatialMultiplex_p = PNULL;
    McsRBInfoForSpatialMultiplex (*mcsRBInfoBase_p)[MAX_UE_CATEGORY][MAX_MCS_INDEX][MAX_NUM_OF_RB] = PNULL;
    McsRBInfoForSpatialMultiplex *mcsRBInfoForSpatialMultiplex_p = PNULL;
    McsRBInfoForSpatialMultiplex *tempmcsRBInfoForSpatialMultiplex_p = PNULL;
    DlUeCategoryInfo *dlUeCategoryInfo_p = cellSpecificParams_g.\
                                           cellConfigAndInitParams_p[internalCellIndex]->cellParams_p->dlUeCategoryInfo;

    /* SPR 13904 fix start */
    static UInt32  minRBsEnsured = FALSE;
    /* SPR 13904 fix end */
 
   if(0 ==((rbCounter + 1) % rbgSize))
   {
	initialDecrementFactor = 0; 
   }
   else if(sizeOfLastRbg == ((rbCounter + 1) % rbgSize))
   {
	initialDecrementFactor = 1;
   }
   /* SPR 7504 Changes Starts */
   if(!rbCounter)
   {
       /** CA-TDD Changes Start **/
       rbIndexLeastMultipleOfRbgSize[internalCellIndex] = 0;
       /** CA-TDD Changes Stop **/
       /* SPR 13904 fix start */
       minRBsEnsured = FALSE;
       /* SPR 13904 fix end */
   }    
   /* SPR 7504 Changes Ends */

    /* SPR 13904 fix start */
    if((0 ==((rbCounter + 1) % rbgSize)) ||
            ((sizeOfLastRbg == ((rbCounter + 1) % rbgSize)) && (minRBsEnsured == TRUE )))    
    {
    /* SPR 13904 fix end */
        /** CA-TDD Changes Start **/
        rbIndexLeastMultipleOfRbgSize[internalCellIndex] = rbCounter;
        /** CA-TDD Changes Stop **/

        for (ueCategoryIndex = 0;ueCategoryIndex  < MAX_UE_CATEGORY; ueCategoryIndex++)
        {
            maxBitsDLSCHTb = dlUeCategoryInfo_p[ueCategoryIndex].maxBitsDLSCHTb;
            maxDLSCHTbBits = dlUeCategoryInfo_p[ueCategoryIndex].maxDLSCHTbBits;
            rbDecrementFactor = initialDecrementFactor;
            maxMcsForMaxTbBits = 0;
            minMcsForMaxTbBits = 0;
            allocatedRbForMaxTbBits = 0;
            tbSizeForMaxTbBits = 0;
            minMcsMaxMcsRbCombinationSuccess = 0;


            mcsRBInfo_p =
                &(mcsRBMapForCodeRateUeCategory_g[cfiValueIndex].mcsRBTBSIzeInfoForNonSpatialMultiplex);
            mcsRBInfoForNonSpatialMultiplex_p =  &((*mcsRBInfo_p)[ueCategoryIndex][rbCounter]);
            maxMcsValue = mcsRBInfoForNonSpatialMultiplex_p->mcsIndexForRat0WithLastRBG;
            maxAllocatedRB = mcsRBInfoForNonSpatialMultiplex_p->numberOfresourceBlocksForRat0WithLastRBG;
            if(maxAllocatedRB >= 1)
                maxAllocatedRB = maxAllocatedRB - 1;
            /*Coverity_Warning_Fix_Start*/
            if(maxMcsValue < MAX_MCS_INDEX) 
            {
                itbsIndex = TBSArr[maxMcsValue];
            }
            /*Coverity_Warning_Fix_End*/
            maxTbSize = TBSizeArr[itbsIndex][maxAllocatedRB];
            /*4x4 DL MIMO CHG START*/
            maxTbSize = MULTIPLY_BY_EIGHT(maxTbSize);
            /*4x4 DL MIMO CHG END*/
            itbsIndex = TBSArr[mcsIndexForTbTwo];
            minTbSize = TBSizeArr[itbsIndex][maxAllocatedRB];
            /*4x4 DL MIMO CHG START*/
            minTbSize = MULTIPLY_BY_EIGHT(minTbSize);
            /*4x4 DL MIMO CHG END*/
            minMcsValue = mcsIndexForTbTwo;
            mcsIndex = minMcsValue;
            maxMcsForMinMcs = 0;
            maxTbSizeForMinMcs = 0;
            do
            {
                /* Cyclomatic_complexity_changes_start */
                getModSchemeFromMcsIndex(mcsIndex, &modScheme);
                /* Cyclomatic_complexity_changes_end */

                maxNumberOfCodedBits = (*maxNumberOfCodedBitsMap_p)[(((modScheme)/QPSK) - 1)][maxAllocatedRB][0];
                /*Coverity_Warning_Fix_Start*/
                if(mcsIndex < MAX_MCS_INDEX) 
                {
                    itbsIndex = TBSArr[mcsIndex];
                }
                /*Coverity_Warning_Fix_End*/
                tbSize = TBSizeArr[itbsIndex][maxAllocatedRB];
                /*4x4 DL MIMO CHG START*/
                tbSize = MULTIPLY_BY_EIGHT(tbSize);
                /*4x4 DL MIMO CHG END*/
                crcBits = PDSCH_CRC_BITS;
                if ((tbSize + PDSCH_CRC_BITS) > MAX_CODE_BLOCK_SIZE)
                {
                    numOfCodeBlock = ceil_wrapper((tbSize+PDSCH_CRC_BITS)/\
                            (MAX_CODE_BLOCK_SIZE - PDSCH_CRC_BITS));
                    crcBits = (numOfCodeBlock*PDSCH_CRC_BITS);
                }
                if(((tbSize + crcBits) <= maxNumberOfCodedBits) &&
                        (tbSize <= maxBitsDLSCHTb))
                {
                    if(tbSize  > maxTbSizeForMinMcs)
                    {
                        maxTbSizeForMinMcs = tbSize;
                        maxMcsForMinMcs = mcsIndex;
                    }
                }
                mcsIndex--;
            }while (mcsIndex >= 0);

            minMcsValue =  maxMcsForMinMcs;
            minTbSize = maxTbSizeForMinMcs;	    

            /* + Coverity 32411, 32410 */
            /* maxMcsForMaxTbBits = initialMaxMcsValue = maxMcsValue; */
            maxMcsForMaxTbBits = maxMcsValue;
            /* - Coverity 32411, 32410 */
            minMcsForMaxTbBits = initialMinMcsValue = minMcsValue; 
            allocatedRbForMaxTbBits = maxAllocatedRB;
            initialMaxTbSize = maxTbSize;
            initialMinTbSize = minTbSize;

            maxDLSCHTbBits = dlUeCategoryInfo_p[ueCategoryIndex].maxDLSCHTbBits;

            if((maxTbSize + minTbSize) > maxDLSCHTbBits)
            {
                minRbThresholdValue = maxAllocatedRB / LOWER_RB_THRESHOLD_FACTOR;
                minRbThresholdValue = maxAllocatedRB - minRbThresholdValue;
                tempRbIndex = maxAllocatedRB;

                do
                {    
                    mcsIndex = (SInt8)minMcsValue;
                    maxTbSize = initialMaxTbSize;
                    minTbSize = initialMinTbSize;

                    /*SPR 12615 Start*/
                    if((mcsIndex > 0) && (mcsIndex < MAX_MCS_INDEX))
                    {
                        /*SPR 12615 End*/
                        do
                        {
                            mcsIndex--;
                            /*Coverity_Warning_Fix_Start*/
                            if(mcsIndex < MAX_MCS_INDEX) 
                            {
                                itbsIndex = TBSArr[mcsIndex];
                            }
                            /*Coverity_Warning_Fix_End*/
                            minTbSize = TBSizeArr[itbsIndex][maxAllocatedRB];
                            /*4x4 DL MIMO CHG START*/
                            minTbSize = MULTIPLY_BY_EIGHT(minTbSize);
                            /*4x4 DL MIMO CHG END*/

                            if((maxTbSize + minTbSize) == maxDLSCHTbBits)
                            {
                                minMcsMaxMcsRbCombinationSuccess = 1;
                                break;
                            }
                        }while (((maxTbSize + minTbSize) > maxDLSCHTbBits) && (mcsIndex >=1));
                    /*SPR 12615 Start*/
                    }
                    /*SPR 12615 End*/

                    if(((maxTbSize + minTbSize) > maxDLSCHTbBits) && (mcsIndex <= 0))
                    {
                        maxMcsForMaxTbBitsByMinMcsReduction = 0;
                        minMcsForMaxTbBitsByMinMcsReduction = 0;
                        allocatedRbForMaxTbBitsByMinMcsReduction = 0;
                        tbSizeForMaxTbBitsByMinMcsReduction = 0;
                    }
                    else
                    {    

                        if(0 != minMcsMaxMcsRbCombinationSuccess)
                        {
                            maxMcsForMaxTbBits = maxMcsValue;
                            minMcsForMaxTbBits = mcsIndex;
                            allocatedRbForMaxTbBits = maxAllocatedRB;
                            break;
                        }
                        else
                        {		
                            maxMcsForMaxTbBitsByMinMcsReduction = maxMcsValue;
                            minMcsForMaxTbBitsByMinMcsReduction = mcsIndex;
                            allocatedRbForMaxTbBitsByMinMcsReduction = maxAllocatedRB;

                            tbSizeForMaxTbBitsByMinMcsReduction = 
                                (maxTbSize + minTbSize);
                        }
                    }

                    mcsIndex = (SInt8)maxMcsValue;
                    minTbSize = initialMinTbSize;
                    maxTbSize = initialMaxTbSize;

                    /*SPR 12615 Start*/
                    if((mcsIndex > 0) && (mcsIndex < MAX_MCS_INDEX))
                    {
                        /*SPR 12615 End*/
                        do
                        {
                            mcsIndex--;
                            /*Coverity_Warning_Fix_Start*/
                            if(mcsIndex < MAX_MCS_INDEX) 
                            {
                                itbsIndex = TBSArr[mcsIndex];
                            }
                            /*Coverity_Warning_Fix_End*/
                            maxTbSize = TBSizeArr[itbsIndex][maxAllocatedRB];
                            /*4x4 DL MIMO CHG START*/
                            maxTbSize = MULTIPLY_BY_EIGHT(maxTbSize);
                            /*4x4 DL MIMO CHG END*/

                            if((maxTbSize + minTbSize) == maxDLSCHTbBits)
                            {
                                minMcsMaxMcsRbCombinationSuccess = 2;
                                break;
                            }

                        }while (((maxTbSize + minTbSize) > maxDLSCHTbBits) &&
                                (mcsIndex >= 1));
                    /*SPR 12615 Start*/
                    }
                    /*SPR 12615 End*/

                    if(((maxTbSize + minTbSize) > maxDLSCHTbBits) &&
                            (mcsIndex <= 0))
                    {
                        maxMcsForMaxTbBitsByMaxMcsReduction = 0;
                        minMcsForMaxTbBitsByMaxMcsReduction = 0;
                        allocatedRbForMaxTbBitsByMaxMcsReduction = 0;	
                        tbSizeForMaxTbBitsByMaxMcsReduction = 0;	
                    }
                    else
                    {    
                        if(0 != minMcsMaxMcsRbCombinationSuccess)
                        {
                            maxMcsForMaxTbBits = mcsIndex;
                            minMcsForMaxTbBits = minMcsValue;
                            allocatedRbForMaxTbBits = maxAllocatedRB;
                            break;
                        }
                        else
                        {		
                            maxMcsForMaxTbBitsByMaxMcsReduction = mcsIndex;
                            minMcsForMaxTbBitsByMaxMcsReduction = minMcsValue;
                            allocatedRbForMaxTbBitsByMaxMcsReduction = maxAllocatedRB;

                            tbSizeForMaxTbBitsByMaxMcsReduction = 
                                (maxTbSize + minTbSize);

                        }	

                    }
                    if(0 == rbDecrementFactor)
                    {
                        if(tempRbIndex >= (rbgSize - sizeOfLastRbg))
                        {
                            tempRbIndex = (tempRbIndex - (rbgSize - sizeOfLastRbg));
                            rbDecrementFactor = 1;
                        }
                    }
                    else
                    {

                        if(tempRbIndex >= sizeOfLastRbg)
                        {
                            tempRbIndex = (tempRbIndex - sizeOfLastRbg);
                            rbDecrementFactor = 0;
                        }

                    }

                    mcsRBInfoForNonSpatialMultiplex_p =  &((*mcsRBInfo_p)[ueCategoryIndex][tempRbIndex]);

                    maxMcsValue = mcsRBInfoForNonSpatialMultiplex_p->mcsIndexForRat0;
                    maxAllocatedRB = mcsRBInfoForNonSpatialMultiplex_p->numberOfresourceBlocksForRat0;

                    if(maxAllocatedRB >= 1)
                        maxAllocatedRB = maxAllocatedRB - 1;

                    if(initialMinMcsValue > maxMcsValue)
                    {
                        minMcsValue = maxMcsValue;
                    }
                    else
                    {
                        minMcsValue = initialMinMcsValue;
                    }
                    /*Coverity_Warning_Fix_Start*/
                    if(mcsIndex < MAX_MCS_INDEX) 
                    {
                        itbsIndex = TBSArr[minMcsValue];
                    }
                    /*Coverity_Warning_Fix_End*/
                    minTbSize = TBSizeArr[itbsIndex][maxAllocatedRB];
                    /*4x4 DL MIMO CHG START*/
                    minTbSize = MULTIPLY_BY_EIGHT(minTbSize);
                    /*4x4 DL MIMO CHG END*/
                    /*Coverity_Warning_Fix_Start*/
                    if(maxMcsValue < MAX_MCS_INDEX) 
                    {
                      itbsIndex = TBSArr[maxMcsValue];
                    }
                    /*Coverity_Warning_Fix_End*/
                    maxTbSize = TBSizeArr[itbsIndex][maxAllocatedRB];
                    /*4x4 DL MIMO CHG START*/
                    maxTbSize = MULTIPLY_BY_EIGHT(maxTbSize);
                    /*4x4 DL MIMO CHG END*/

                    initialMinTbSize = minTbSize;
                    initialMaxTbSize = maxTbSize;
                    tbSizeForMaxTbBitsByRbReduction = (maxTbSize + minTbSize);

                    if(tbSizeForMaxTbBitsByRbReduction == maxDLSCHTbBits)
                    {
                        maxMcsForMaxTbBits = maxMcsValue;
                        minMcsForMaxTbBits = minMcsValue;
                        allocatedRbForMaxTbBits = maxAllocatedRB;	
                        break;
                    }
                    else if(tbSizeForMaxTbBitsByRbReduction < maxDLSCHTbBits) 
                    {
                        maxMcsForMaxTbBitsByRbReduction = maxMcsValue;
                        minMcsForMaxTbBitsByRbReduction = minMcsValue;
                        allocatedRbForMaxTbBitsByRbReduction = maxAllocatedRB;

                        if(tbSizeForMaxTbBitsByMaxMcsReduction >= tbSizeForMaxTbBitsByMinMcsReduction)
                        {
                            if(tbSizeForMaxTbBitsByMaxMcsReduction >= tbSizeForMaxTbBitsByRbReduction)
                            {
                                if(tbSizeForMaxTbBitsByMaxMcsReduction >= tbSizeForMaxTbBits)
                                {
                                    maxMcsForMaxTbBits = maxMcsForMaxTbBitsByMaxMcsReduction;
                                    minMcsForMaxTbBits = minMcsForMaxTbBitsByMaxMcsReduction;
                                    allocatedRbForMaxTbBits = allocatedRbForMaxTbBitsByMaxMcsReduction;
                                    tbSizeForMaxTbBits = tbSizeForMaxTbBitsByMaxMcsReduction;
                                }
                            }
                            else if(tbSizeForMaxTbBitsByRbReduction >=tbSizeForMaxTbBits)
                            {
                                maxMcsForMaxTbBits = maxMcsForMaxTbBitsByRbReduction;
                                minMcsForMaxTbBits = minMcsForMaxTbBitsByRbReduction;
                                allocatedRbForMaxTbBits = allocatedRbForMaxTbBitsByRbReduction;
                                tbSizeForMaxTbBits = tbSizeForMaxTbBitsByRbReduction;
                            }
                        }
                        else if(tbSizeForMaxTbBitsByMinMcsReduction >= tbSizeForMaxTbBitsByRbReduction)
                        {
                            if(tbSizeForMaxTbBitsByMinMcsReduction >= tbSizeForMaxTbBits)
                            {
                                maxMcsForMaxTbBits = maxMcsForMaxTbBitsByMinMcsReduction;
                                minMcsForMaxTbBits = minMcsForMaxTbBitsByMinMcsReduction;
                                allocatedRbForMaxTbBits = allocatedRbForMaxTbBitsByMinMcsReduction;
                                tbSizeForMaxTbBits = tbSizeForMaxTbBitsByMinMcsReduction;
                            }

                        }
                        else if(tbSizeForMaxTbBitsByRbReduction >= tbSizeForMaxTbBits)
                        {
                            maxMcsForMaxTbBits = maxMcsForMaxTbBitsByRbReduction;
                            minMcsForMaxTbBits = minMcsForMaxTbBitsByRbReduction;
                            allocatedRbForMaxTbBits = allocatedRbForMaxTbBitsByRbReduction;
                            tbSizeForMaxTbBits = tbSizeForMaxTbBitsByRbReduction;
                        }
                    }
                    else
                    {
                        if(tbSizeForMaxTbBitsByMaxMcsReduction >= tbSizeForMaxTbBitsByMinMcsReduction)
                        {
                            if(tbSizeForMaxTbBitsByMaxMcsReduction >= tbSizeForMaxTbBits)
                            {
                                maxMcsForMaxTbBits = maxMcsForMaxTbBitsByMaxMcsReduction;
                                minMcsForMaxTbBits = minMcsForMaxTbBitsByMaxMcsReduction;
                                allocatedRbForMaxTbBits = allocatedRbForMaxTbBitsByMaxMcsReduction;
                                tbSizeForMaxTbBits = tbSizeForMaxTbBitsByMaxMcsReduction;
                            }
                        }
                        else if(tbSizeForMaxTbBitsByMinMcsReduction >= tbSizeForMaxTbBits)
                        {
                            maxMcsForMaxTbBits = maxMcsForMaxTbBitsByMinMcsReduction;
                            minMcsForMaxTbBits = minMcsForMaxTbBitsByMinMcsReduction;
                            allocatedRbForMaxTbBits = allocatedRbForMaxTbBitsByMinMcsReduction;
                            tbSizeForMaxTbBits = tbSizeForMaxTbBitsByMinMcsReduction;

                        }

                    }

                }while((tempRbIndex > minRbThresholdValue)); 
            }
            mcsRBInfoBase_p =
                &(mcsRBMapForCodeRateUeCategory_g[cfiValueIndex].mcsRBTBSIzeInfoForSpatialMultiplex);

            mcsRBInfoForSpatialMultiplex_p =  &((*mcsRBInfoBase_p)[ueCategoryIndex][mcsIndexForTbTwo][rbCounter]);

            mcsRBInfoForSpatialMultiplex_p->mcsIndexForTbOneRat0WithLastRBG = maxMcsForMaxTbBits;
            mcsRBInfoForSpatialMultiplex_p->mcsIndexForTbTwoRat0WithLastRBG = minMcsForMaxTbBits;
            mcsRBInfoForSpatialMultiplex_p->numberOfresourceBlocksForRat0WithLastRBG = (allocatedRbForMaxTbBits + 1);
        }
    }
    else
    {
        /* SPR 13904 fix start */
        if(((0 != sizeOfLastRbg) && ((rbCounter + 1) >= sizeOfLastRbg)&& (minRBsEnsured == TRUE)) ||
            ((0 == sizeOfLastRbg) && ((rbCounter + 1) >= rbgSize)))
        {
        /* SPR 13904 fix end */
        for (ueCategoryIndex = 0;ueCategoryIndex  < MAX_UE_CATEGORY; ueCategoryIndex++)
        {
            mcsRBInfoBase_p =
                &(mcsRBMapForCodeRateUeCategory_g[cfiValueIndex].mcsRBTBSIzeInfoForSpatialMultiplex);
            /** CA-TDD Changes Start **/
            tempmcsRBInfoForSpatialMultiplex_p =  
                &((*mcsRBInfoBase_p)[ueCategoryIndex][mcsIndexForTbTwo][rbIndexLeastMultipleOfRbgSize[internalCellIndex]]); 
            /** CA-TDD Changes Stop **/
            mcsRBInfoForSpatialMultiplex_p =  
                &((*mcsRBInfoBase_p)[ueCategoryIndex][mcsIndexForTbTwo][rbCounter]); 

            mcsRBInfoForSpatialMultiplex_p->mcsIndexForTbOneRat0WithLastRBG = 
                tempmcsRBInfoForSpatialMultiplex_p->mcsIndexForTbOneRat0WithLastRBG;
            mcsRBInfoForSpatialMultiplex_p->mcsIndexForTbTwoRat0WithLastRBG = 
                tempmcsRBInfoForSpatialMultiplex_p->mcsIndexForTbTwoRat0WithLastRBG;
            mcsRBInfoForSpatialMultiplex_p->numberOfresourceBlocksForRat0WithLastRBG = 
                tempmcsRBInfoForSpatialMultiplex_p->numberOfresourceBlocksForRat0WithLastRBG;

            }
        }
        /* SPR 13904 fix start */
        else if(((0 != sizeOfLastRbg) && ((rbCounter + 1) <= sizeOfLastRbg)) ||
                     ((0 == sizeOfLastRbg) && ((rbCounter + 1) < rbgSize)))
        {
            for (ueCategoryIndex = 0;ueCategoryIndex  < MAX_UE_CATEGORY; ueCategoryIndex++)
            {
                mcsRBInfoBase_p =
                    &(mcsRBMapForCodeRateUeCategory_g[cfiValueIndex].mcsRBTBSIzeInfoForSpatialMultiplex);
                /** CA-TDD Changes Start **/

                /** CA-TDD Changes Stop **/

                mcsRBInfoForSpatialMultiplex_p =
                    &((*mcsRBInfoBase_p)[ueCategoryIndex][mcsIndexForTbTwo][rbCounter]);

                mcsRBInfoForSpatialMultiplex_p->mcsIndexForTbOneRat0WithLastRBG =
                    mcsIndexForTbOne;
                mcsRBInfoForSpatialMultiplex_p->mcsIndexForTbTwoRat0WithLastRBG =
                    mcsIndexForTbTwo;
                mcsRBInfoForSpatialMultiplex_p->numberOfresourceBlocksForRat0WithLastRBG =
                    rbCounter + 1;
            }
            minRBsEnsured = TRUE;
        }
        /* SPR 13904 fix end */
    }

}


/*****************************************************************************
 * Function Name  : calculateMaxMcsRbInfoForRat1AndRat2SpatialMultiplex
 * Inputs         : rbCounter - number Of allocated Resource Blocks,
 *                  cfiValueIndex - cfi Value,
 *                  mcsIndexForTbOne - allocated Mcs for TB One,
 *                  mcsIndexForTbTwo - allocated Mcs for TB Two,
 *                  maxNumberOfCodedBitsMap_p - Pointer to array which contains
 *                                              maximum Bits which can be coded 
 *                                              below max code rate value
 *                  internalCellIndex - Cell-Index at MAC
 * Outputs        : None
 * Returns        : None
 * Description    : This function will find the maximum possible MCS for 
 *                  TB One and TB Two and RB value below Code Rate 
 *                  and for each UE Category in RAT1 and RAT2.
 *****************************************************************************/

void calculateMaxMcsRbInfoForRat1AndRat2SpatialMultiplex(UInt8 rbCounter,
                             /* +- SPR 17777 */
                             UInt8 cfiValueIndex,
                             UInt8 mcsIndexForTbTwo,
                             UInt32 (*maxNumberOfCodedBitsMap_p)[MAX_MOD_SCHEME][MAX_NUM_OF_RB][MAX_NUM_OVERLAPPING_RB],
                             InternalCellIndex internalCellIndex)

{
    UInt8 maxAllocatedRB = 0;
    UInt8 resourceBlockIndex = 0;
    SInt8 minRbThresholdValue = 0;
    SInt8 tempRbIndex = 0;
    UInt8 itbsIndex = 0;
    UInt8 minMcsValue = 0;
    UInt8 maxMcsValue = 0;
    UInt8 initialMinMcsValue = 0;
    UInt8 maxMcsForMaxTbBitsByMaxMcsReduction = 0;
    UInt8 minMcsForMaxTbBitsByMaxMcsReduction = 0;
    UInt8 allocatedRbForMaxTbBitsByMaxMcsReduction = 0;
    UInt8 maxMcsForMaxTbBitsByMinMcsReduction = 0;
    UInt8 minMcsForMaxTbBitsByMinMcsReduction = 0;
    UInt8 allocatedRbForMaxTbBitsByMinMcsReduction = 0;
    UInt8 maxMcsForMaxTbBitsByRbReduction = 0;
    UInt8 minMcsForMaxTbBitsByRbReduction = 0;
    UInt8 allocatedRbForMaxTbBitsByRbReduction = 0;
    UInt8 maxMcsForMaxTbBits = 0;
    UInt8 minMcsForMaxTbBits = 0;
    UInt8 allocatedRbForMaxTbBits = 0;
    UInt8 minMcsMaxMcsRbCombinationSuccess = 0;
    UInt8 ueCategoryIndex = 0;
    UInt8 maxMcsForMinMcs = 0;
    UInt8 modScheme = 0;
    SInt8 mcsIndex = 0;
    UInt16 numOfCodeBlock = 0;
    UInt32 initialMinTbSize = 0;
    UInt32 initialMaxTbSize = 0;
    UInt32 minTbSize = 0;
    UInt32 maxTbSize = 0;
    UInt32 tbSizeForMaxTbBitsByMaxMcsReduction = 0;
    UInt32 tbSizeForMaxTbBitsByMinMcsReduction = 0;
    UInt32 tbSizeForMaxTbBitsByRbReduction = 0;
    UInt32 tbSizeForMaxTbBits = 0;
    UInt32 maxBitsDLSCHTb = 0;
    UInt32 maxDLSCHTbBits = 0;
    UInt32 maxTbSizeForMinMcs = 0;
    UInt32 crcBitsForMaxTbSize = 0;
    UInt32 crcBits = 0;
    UInt32 tbSize = 0;
    UInt32 maxNumberOfCodedBits = 0;
    McsRBInfoForNonSpatialMultiplex (*mcsRBInfo_p)[MAX_UE_CATEGORY][MAX_NUM_OF_RB] = PNULL;
    McsRBInfoForNonSpatialMultiplex *mcsRBInfoForNonSpatialMultiplex_p = PNULL;
    McsRBInfoForSpatialMultiplex (*mcsRBInfoBase_p)[MAX_UE_CATEGORY][MAX_MCS_INDEX][MAX_NUM_OF_RB] = PNULL;
    McsRBInfoForSpatialMultiplex *mcsRBInfoForSpatialMultiplex_p = PNULL;
    DlUeCategoryInfo *dlUeCategoryInfo_p = cellSpecificParams_g.\
                                           cellConfigAndInitParams_p[internalCellIndex]->cellParams_p->dlUeCategoryInfo;

    for (ueCategoryIndex = 0;ueCategoryIndex  < MAX_UE_CATEGORY; ueCategoryIndex++)
    {
        maxBitsDLSCHTb = dlUeCategoryInfo_p[ueCategoryIndex].maxBitsDLSCHTb;
        maxDLSCHTbBits = dlUeCategoryInfo_p[ueCategoryIndex].maxDLSCHTbBits;

        maxMcsForMaxTbBits = 0;
        minMcsForMaxTbBits = 0;
        allocatedRbForMaxTbBits = 0;
        tbSizeForMaxTbBits = 0;
        minMcsMaxMcsRbCombinationSuccess = 0;
        maxMcsForMinMcs = 0;
        crcBitsForMaxTbSize = 0;
        maxTbSizeForMinMcs = 0;

        mcsRBInfo_p =
            &(mcsRBMapForCodeRateUeCategory_g[cfiValueIndex].mcsRBTBSIzeInfoForNonSpatialMultiplex);

        mcsRBInfoForNonSpatialMultiplex_p =  &((*mcsRBInfo_p)[ueCategoryIndex][rbCounter]);
        maxMcsValue = mcsRBInfoForNonSpatialMultiplex_p->mcsIndexForRat1AndRat2;
        maxAllocatedRB = mcsRBInfoForNonSpatialMultiplex_p->numberOfresourceBlocksForRat1AndRat2;
        if(maxAllocatedRB >= 1)
            maxAllocatedRB = maxAllocatedRB - 1;
        /*Coverity_Warning_Fix_Start*/
        if(maxMcsValue < MAX_MCS_INDEX) 
        {
            itbsIndex = TBSArr[maxMcsValue];
        }    
        /*Coverity_Warning_Fix_End*/
        maxTbSize = TBSizeArr[itbsIndex][maxAllocatedRB];
        /*4x4 DL MIMO CHG START*/
        maxTbSize = MULTIPLY_BY_EIGHT(maxTbSize);
        /*4x4 DL MIMO CHG END*/
        itbsIndex = TBSArr[mcsIndexForTbTwo];
        minTbSize = TBSizeArr[itbsIndex][maxAllocatedRB];
        minMcsValue = mcsIndexForTbTwo;
        /*4x4 DL MIMO CHG START*/
        minTbSize = MULTIPLY_BY_EIGHT(minTbSize);
        /*4x4 DL MIMO CHG END*/
        minMcsValue = mcsIndexForTbTwo;
        mcsIndex = mcsIndexForTbTwo;
        resourceBlockIndex = maxAllocatedRB;
        crcBits = PDSCH_CRC_BITS;
        do
        {
            /* Cyclomatic_complexity_changes_start */
            getModSchemeFromMcsIndex(mcsIndex, &modScheme);
            /* Cyclomatic_complexity_changes_end */

            maxNumberOfCodedBits = (*maxNumberOfCodedBitsMap_p)[(((modScheme)/QPSK) - 1)][resourceBlockIndex][0];

            /*Coverity_Warning_Fix_Start*/
            if(mcsIndex < MAX_MCS_INDEX) 
            {
                itbsIndex = TBSArr[mcsIndex];
            }
            /*Coverity_Warning_Fix_End*/
            tbSize = TBSizeArr[itbsIndex][resourceBlockIndex];
            /*4x4 DL MIMO CHG START*/
            tbSize = MULTIPLY_BY_EIGHT(tbSize);
            /*4x4 DL MIMO CHG END*/
            if ((tbSize + PDSCH_CRC_BITS) > MAX_CODE_BLOCK_SIZE)
            {
                numOfCodeBlock = ceil_wrapper((tbSize+PDSCH_CRC_BITS)/\
                        (MAX_CODE_BLOCK_SIZE - PDSCH_CRC_BITS));
                crcBits = (numOfCodeBlock*PDSCH_CRC_BITS);
            }
            if(((tbSize + crcBits) <= maxNumberOfCodedBits) &&
                    (tbSize <= maxBitsDLSCHTb))
            {
                if((tbSize + crcBits) > (maxTbSizeForMinMcs + crcBitsForMaxTbSize))
                {
                    maxTbSizeForMinMcs = tbSize;
                    crcBitsForMaxTbSize = crcBits;
                    maxMcsForMinMcs = mcsIndex;
                }
            }
            mcsIndex--;
        }while (mcsIndex >= 0);

        minMcsValue =  maxMcsForMinMcs;
        minTbSize = maxTbSizeForMinMcs;

        /* + Coverity 32410 */
        /* maxMcsForMaxTbBits = initialMaxMcsValue = maxMcsValue; */
        maxMcsForMaxTbBits = maxMcsValue;
        /* - Coverity 32410 */
        minMcsForMaxTbBits = initialMinMcsValue = minMcsValue;
        allocatedRbForMaxTbBits = maxAllocatedRB;
        initialMaxTbSize = maxTbSize;
        initialMinTbSize = minTbSize;
        if(maxDLSCHTbBits == maxTbSize )
        {
            minMcsForMaxTbBits = 29;/*invalid MCS*/	
        }
        if(maxDLSCHTbBits == minTbSize )
        {
            maxMcsForMaxTbBits = 29;/*invalid MCS*/	
        }
        maxDLSCHTbBits = dlUeCategoryInfo_p[ueCategoryIndex].maxDLSCHTbBits;

        if(((maxTbSize + minTbSize) > maxDLSCHTbBits) && ((maxMcsForMaxTbBits < 29 ) && (minMcsForMaxTbBits < 29 )))
        {
            minRbThresholdValue = maxAllocatedRB / LOWER_RB_THRESHOLD_FACTOR;
            minRbThresholdValue = maxAllocatedRB - minRbThresholdValue;
            tempRbIndex = maxAllocatedRB;

            do
            {    
                mcsIndex = (SInt8)minMcsValue;
                maxTbSize = initialMaxTbSize;
                minTbSize = initialMinTbSize;
                crcBits = PDSCH_CRC_BITS;

                maxMcsForMaxTbBitsByMinMcsReduction = 0;
                minMcsForMaxTbBitsByMinMcsReduction = 0;
                allocatedRbForMaxTbBitsByMinMcsReduction = 0;
                tbSizeForMaxTbBitsByMinMcsReduction = 0;
                crcBitsForMaxTbSize = 0;
                do
                {
                    /*Coverity_Warning_Fix_Start*/
                    if(mcsIndex < MAX_MCS_INDEX) 
                    {
                        itbsIndex = TBSArr[mcsIndex];
                    }
                    /*Coverity_Warning_Fix_End*/
                    minTbSize = TBSizeArr[itbsIndex][maxAllocatedRB];
                    /*4x4 DL MIMO CHG START*/
                    minTbSize = MULTIPLY_BY_EIGHT(minTbSize);
                    /*4x4 DL MIMO CHG END*/

                    /* Cyclomatic_complexity_changes_start */
                    getModSchemeFromMcsIndex(mcsIndex, &modScheme);
                    /* Cyclomatic_complexity_changes_end */

                    maxNumberOfCodedBits = (*maxNumberOfCodedBitsMap_p)[(((modScheme)/QPSK) - 1)][maxAllocatedRB][0];

                    if ((minTbSize + PDSCH_CRC_BITS) > MAX_CODE_BLOCK_SIZE)
                    {
                        numOfCodeBlock = ceil_wrapper((minTbSize+PDSCH_CRC_BITS)/\
                                (MAX_CODE_BLOCK_SIZE - PDSCH_CRC_BITS));
                        crcBits = (numOfCodeBlock*PDSCH_CRC_BITS);
                    }

                    if(((maxTbSize + minTbSize) == maxDLSCHTbBits) &&
                            ((minTbSize + crcBits) <=  maxNumberOfCodedBits)) 
                    {
                        minMcsMaxMcsRbCombinationSuccess = 1;
                        break;
                    }

                    if(((maxTbSize + minTbSize) <= maxDLSCHTbBits) &&
                            ((minTbSize + crcBits) <=  maxNumberOfCodedBits))
                    {
                        if((minTbSize + crcBits) > 
                                (tbSizeForMaxTbBitsByMinMcsReduction + crcBitsForMaxTbSize))
                        {
                            maxMcsForMaxTbBitsByMinMcsReduction = maxMcsValue;
                            minMcsForMaxTbBitsByMinMcsReduction = mcsIndex;
                            allocatedRbForMaxTbBitsByMinMcsReduction = maxAllocatedRB;
                            crcBitsForMaxTbSize = crcBits;
                            tbSizeForMaxTbBitsByMinMcsReduction =  minTbSize;
                        }	
                    }	

                    mcsIndex--;

                }while (mcsIndex >=0);

                tbSizeForMaxTbBitsByMinMcsReduction = 
                    (maxTbSize + tbSizeForMaxTbBitsByMinMcsReduction);

                if(0 != minMcsMaxMcsRbCombinationSuccess)
                {
                    maxMcsForMaxTbBits = maxMcsValue;
                    minMcsForMaxTbBits = mcsIndex;
                    allocatedRbForMaxTbBits = maxAllocatedRB;
                    break;
                }

                mcsIndex = (SInt8)maxMcsValue;
                minTbSize = initialMinTbSize;
                maxTbSize = initialMaxTbSize;
                crcBits = PDSCH_CRC_BITS;
                maxMcsForMaxTbBitsByMaxMcsReduction = 0;
                minMcsForMaxTbBitsByMaxMcsReduction = 0;
                allocatedRbForMaxTbBitsByMaxMcsReduction = 0;	
                tbSizeForMaxTbBitsByMaxMcsReduction = 0;	
                crcBitsForMaxTbSize = 0;
                do
                {
                    /*Coverity_Warning_Fix_Start*/
                    if(mcsIndex < MAX_MCS_INDEX) 
                    {
                        itbsIndex = TBSArr[mcsIndex];
                    }
                    /*Coverity_Warning_Fix_End*/
                    maxTbSize = TBSizeArr[itbsIndex][maxAllocatedRB];
                    /*4x4 DL MIMO CHG START*/
                    maxTbSize = MULTIPLY_BY_EIGHT(maxTbSize);
                    /*4x4 DL MIMO CHG END*/

                    /* Cyclomatic_complexity_changes_start */
                    getModSchemeFromMcsIndex(mcsIndex, &modScheme);
                    /* Cyclomatic_complexity_changes_end */

                    maxNumberOfCodedBits = (*maxNumberOfCodedBitsMap_p)[(((modScheme)/QPSK) - 1)][maxAllocatedRB][0];

                    if ((maxTbSize + PDSCH_CRC_BITS) > MAX_CODE_BLOCK_SIZE)
                    {
                        numOfCodeBlock = ceil_wrapper((maxTbSize+PDSCH_CRC_BITS)/\
                                (MAX_CODE_BLOCK_SIZE - PDSCH_CRC_BITS));
                        crcBits = (numOfCodeBlock*PDSCH_CRC_BITS);
                    }


                    if(((maxTbSize + minTbSize) == maxDLSCHTbBits) &&
                            ((maxTbSize + crcBits) <=  maxNumberOfCodedBits)) 
                    {
                        minMcsMaxMcsRbCombinationSuccess = 2;
                        break;
                    }

                    if(((maxTbSize + minTbSize) <= maxDLSCHTbBits) &&
                            ((maxTbSize + crcBits) <=  maxNumberOfCodedBits)) 
                    {

                        if((maxTbSize + crcBits) > (tbSizeForMaxTbBitsByMaxMcsReduction + crcBitsForMaxTbSize))
                        {
                            maxMcsForMaxTbBitsByMaxMcsReduction = mcsIndex;
                            minMcsForMaxTbBitsByMaxMcsReduction = minMcsValue;
                            allocatedRbForMaxTbBitsByMaxMcsReduction = maxAllocatedRB;
                            crcBitsForMaxTbSize = crcBits;
                            tbSizeForMaxTbBitsByMaxMcsReduction =  maxTbSize;
                        }	
                    }	

                    mcsIndex--;

                }while (mcsIndex >=0);

                tbSizeForMaxTbBitsByMaxMcsReduction = 
                    (minTbSize + tbSizeForMaxTbBitsByMaxMcsReduction);
                if(0 != minMcsMaxMcsRbCombinationSuccess)
                {
                    maxMcsForMaxTbBits = mcsIndex;
                    minMcsForMaxTbBits = minMcsValue;
                    allocatedRbForMaxTbBits = maxAllocatedRB;
                    break;
                }

                tempRbIndex = tempRbIndex - 1;

                if(tempRbIndex >= 0)
                {		
                    mcsRBInfoForNonSpatialMultiplex_p =  &((*mcsRBInfo_p)[ueCategoryIndex][tempRbIndex]);

                    maxMcsValue = mcsRBInfoForNonSpatialMultiplex_p->mcsIndexForRat1AndRat2;
                    maxAllocatedRB = mcsRBInfoForNonSpatialMultiplex_p->numberOfresourceBlocksForRat1AndRat2;

                    if(maxAllocatedRB >= 1)
                        maxAllocatedRB = maxAllocatedRB - 1;

                    if(initialMinMcsValue > maxMcsValue)
                    {
                        minMcsValue = maxMcsValue;
                    }
                    else
                    {
                        minMcsValue = initialMinMcsValue;
                    }
                    /*Coverity_Warning_Fix_Start*/
                    if(minMcsValue < MAX_MCS_INDEX) 
                    {
                        itbsIndex = TBSArr[minMcsValue];
                    }
                    /*Coverity_Warning_Fix_End*/
                    minTbSize = TBSizeArr[itbsIndex][maxAllocatedRB];
                    /*4x4 DL MIMO CHG START*/
                    minTbSize = MULTIPLY_BY_EIGHT(minTbSize);
                    /*4x4 DL MIMO CHG END*/
                    /*Coverity_Warning_Fix_Start*/
                    if(maxMcsValue < MAX_MCS_INDEX) 
                    {
                        itbsIndex = TBSArr[maxMcsValue];
                    }
                    /*Coverity_Warning_Fix_End*/
                    maxTbSize = TBSizeArr[itbsIndex][maxAllocatedRB];
                    /*4x4 DL MIMO CHG START*/
                    maxTbSize = MULTIPLY_BY_EIGHT(maxTbSize);
                    /*4x4 DL MIMO CHG END*/

                    initialMaxTbSize = maxTbSize;
                    initialMinTbSize = minTbSize;
                    tbSizeForMaxTbBitsByRbReduction = (maxTbSize + minTbSize);

                    if(tbSizeForMaxTbBitsByRbReduction == maxDLSCHTbBits)
                    {
                        maxMcsForMaxTbBits = maxMcsValue;
                        minMcsForMaxTbBits = minMcsValue;
                        allocatedRbForMaxTbBits = maxAllocatedRB;	
                        break;
                    }
                    if(tbSizeForMaxTbBitsByRbReduction <= maxDLSCHTbBits) 
                    {
                        maxMcsForMaxTbBitsByRbReduction = maxMcsValue;
                        minMcsForMaxTbBitsByRbReduction = minMcsValue;
                        allocatedRbForMaxTbBitsByRbReduction = maxAllocatedRB;
                        if(tbSizeForMaxTbBitsByMaxMcsReduction >= tbSizeForMaxTbBitsByMinMcsReduction)
                        {
                            if(tbSizeForMaxTbBitsByMaxMcsReduction >= tbSizeForMaxTbBitsByRbReduction)
                            {
                                if(tbSizeForMaxTbBitsByMaxMcsReduction >= tbSizeForMaxTbBits)
                                {
                                    maxMcsForMaxTbBits = maxMcsForMaxTbBitsByMaxMcsReduction;
                                    minMcsForMaxTbBits = minMcsForMaxTbBitsByMaxMcsReduction;
                                    allocatedRbForMaxTbBits = allocatedRbForMaxTbBitsByMaxMcsReduction;
                                    tbSizeForMaxTbBits = tbSizeForMaxTbBitsByMaxMcsReduction;
                                }
                            }
                            else if(tbSizeForMaxTbBitsByRbReduction >=tbSizeForMaxTbBits)
                            {
                                maxMcsForMaxTbBits = maxMcsForMaxTbBitsByRbReduction;
                                minMcsForMaxTbBits = minMcsForMaxTbBitsByRbReduction;
                                allocatedRbForMaxTbBits = allocatedRbForMaxTbBitsByRbReduction;
                                tbSizeForMaxTbBits = tbSizeForMaxTbBitsByRbReduction;
                            }
                        }
                        else if(tbSizeForMaxTbBitsByMinMcsReduction >= tbSizeForMaxTbBitsByRbReduction)
                        {
                            if(tbSizeForMaxTbBitsByMinMcsReduction >= tbSizeForMaxTbBits)
                            {
                                maxMcsForMaxTbBits = maxMcsForMaxTbBitsByMinMcsReduction;
                                minMcsForMaxTbBits = minMcsForMaxTbBitsByMinMcsReduction;
                                allocatedRbForMaxTbBits = allocatedRbForMaxTbBitsByMinMcsReduction;
                                tbSizeForMaxTbBits = tbSizeForMaxTbBitsByMinMcsReduction;
                            }
                        }
                        else if(tbSizeForMaxTbBitsByRbReduction >= tbSizeForMaxTbBits)
                        {
                            maxMcsForMaxTbBits = maxMcsForMaxTbBitsByRbReduction;
                            minMcsForMaxTbBits = minMcsForMaxTbBitsByRbReduction;
                            allocatedRbForMaxTbBits = allocatedRbForMaxTbBitsByRbReduction;
                            tbSizeForMaxTbBits = tbSizeForMaxTbBitsByRbReduction;
                        }
                    }
                    else
                    {
                        if(tbSizeForMaxTbBitsByMaxMcsReduction >= tbSizeForMaxTbBitsByMinMcsReduction)
                        {
                            if(tbSizeForMaxTbBitsByMaxMcsReduction >= tbSizeForMaxTbBits)
                            {
                                maxMcsForMaxTbBits = maxMcsForMaxTbBitsByMaxMcsReduction;
                                minMcsForMaxTbBits = minMcsForMaxTbBitsByMaxMcsReduction;
                                allocatedRbForMaxTbBits = allocatedRbForMaxTbBitsByMaxMcsReduction;
                                tbSizeForMaxTbBits = tbSizeForMaxTbBitsByMaxMcsReduction;
                            }
                        }
                        else if(tbSizeForMaxTbBitsByMinMcsReduction >= tbSizeForMaxTbBits)
                        {
                            maxMcsForMaxTbBits = maxMcsForMaxTbBitsByMinMcsReduction;
                            minMcsForMaxTbBits = minMcsForMaxTbBitsByMinMcsReduction;
                            allocatedRbForMaxTbBits = allocatedRbForMaxTbBitsByMinMcsReduction;
                            tbSizeForMaxTbBits = tbSizeForMaxTbBitsByMinMcsReduction;

                        }

                    }
                }
                else
                {
                    if(tbSizeForMaxTbBitsByMaxMcsReduction >= tbSizeForMaxTbBitsByMinMcsReduction)
                    {
                        if(tbSizeForMaxTbBitsByMaxMcsReduction >= tbSizeForMaxTbBits)
                        {
                            maxMcsForMaxTbBits = maxMcsForMaxTbBitsByMaxMcsReduction;
                            minMcsForMaxTbBits = minMcsForMaxTbBitsByMaxMcsReduction;
                            allocatedRbForMaxTbBits = allocatedRbForMaxTbBitsByMaxMcsReduction;
                            tbSizeForMaxTbBits = tbSizeForMaxTbBitsByMaxMcsReduction;
                        }
                    }
                    else if(tbSizeForMaxTbBitsByMinMcsReduction >= tbSizeForMaxTbBits)
                    {
                        maxMcsForMaxTbBits = maxMcsForMaxTbBitsByMinMcsReduction;
                        minMcsForMaxTbBits = minMcsForMaxTbBitsByMinMcsReduction;
                        allocatedRbForMaxTbBits = allocatedRbForMaxTbBitsByMinMcsReduction;
                        tbSizeForMaxTbBits = tbSizeForMaxTbBitsByMinMcsReduction;

                    }

                }

            }while(tempRbIndex >= minRbThresholdValue); 
        }
        mcsRBInfoBase_p =
            &(mcsRBMapForCodeRateUeCategory_g[cfiValueIndex].mcsRBTBSIzeInfoForSpatialMultiplex);

        mcsRBInfoForSpatialMultiplex_p =  &((*mcsRBInfoBase_p)[ueCategoryIndex][mcsIndexForTbTwo][rbCounter]);

        mcsRBInfoForSpatialMultiplex_p->mcsIndexForTbOneRat1AndRat2 = maxMcsForMaxTbBits;
        mcsRBInfoForSpatialMultiplex_p->mcsIndexForTbTwoRat1AndRat2 = minMcsForMaxTbBits;
        mcsRBInfoForSpatialMultiplex_p->numberOfresourceBlocksForRat1AndRat2 = (allocatedRbForMaxTbBits + 1);
    }

}


/*****************************************************************************
 * Function Name  : calculateNumOfCRS 
 * Inputs         : tempCfiValue - CFI Value
 *                  internalCellIndex - Cell-Index at MAC
 * Outputs        : None
 * Returns        : numOfCRS
 * Description    : This function returns the Cell specific reference signal on the basis 
 *                  of CFI and number of transmission antennas.
 *****************************************************************************/
 UInt8 calculateNumOfCRS(UInt8 tempCfiValue,
        InternalCellIndex internalCellIndex)
{
    UInt8 numOfCRS = 0;
    switch(cellSpecificParams_g.cellConfigAndInitParams_p[internalCellIndex]\
             ->cellParams_p->numOfTxAnteenas)
    {
        case NUM_OF_TX_ANTENNAS_1:
            numOfCRS = 6;
            break;
        case NUM_OF_TX_ANTENNAS_2:
            numOfCRS = 12;
            break;
        case NUM_OF_TX_ANTENNAS_4:
            if (tempCfiValue == CFI_VALUE_1)
            {
                numOfCRS = 20;
            }
            else
            {
                numOfCRS = 16;
            }
            break;
        default:
            break;

    }
    return numOfCRS;
}

