/*****************************************************************************
 * Function Name  : calculateBestCombinationMCSRBFor4LayerMimo
 * Inputs         : masterMcsIndex - MCS Index,
 *                  resourceBlockIndex - RB Index,
 *                  maxMcsBelowCodeRateForRAT0_p - Maximum MCS for code Rate,
 *                  maxRBBelowCodeRateForRAT0_p - Maximum RB for code Rate,
 *                  maxTbSizeForRAT0_p - Maximum TB size for the code Rate,
 *                  maxBitsDLSCHTb  - Maximum Bits schduled on DLSCH,
 *                  maxNumberOfCodedBitsMap_p - Pointer to MAP
 * None           : None
 * Returns        : None
 * Description    : This function will be used to fill the Mcs and RB combination
 *                  for 4-Layer MIMO, which can be used while calculating code rate.
 *****************************************************************************/
void calculateBestCombinationMCSRBFor4LayerMimo( UInt8 masterMcsIndex,
              UInt8 resourceBlockIndex,
              UInt8 *maxMcsBelowCodeRateForRAT0_p,
              UInt8 *maxRBBelowCodeRateForRAT0_p,
              UInt32 *maxTbSizeForRAT0_p,
              UInt32 maxBitsDLSCHTb,
              UInt32 (*maxNumberOfCodedBitsMap_p)[MAX_MOD_SCHEME][MAX_NUM_OF_RB][MAX_NUM_OVERLAPPING_RB])
{
    UInt8 modScheme = 0;
    SInt8 mcsIndex = masterMcsIndex;
    UInt8 itbsIndex = 0;
    UInt16 numOfCodeBlock = 0;
    UInt32 maxNumberOfCodedBits = 0;
    UInt32 tbSize = 0;
    UInt32 crcBits = PDSCH_CRC_BITS;
    do
    {
        /* Cyclomatic_complexity_changes_start */
        getModSchemeFromMcsIndex(mcsIndex, &modScheme);
        /* Cyclomatic_complexity_changes_end */

        maxNumberOfCodedBits = (*maxNumberOfCodedBitsMap_p)[(((modScheme)/QPSK) - 1)][resourceBlockIndex][0];
        /* Multiply the code rate by 2 to make it for 4x4 MIMO */
        maxNumberOfCodedBits = 2*maxNumberOfCodedBits;
        crcBits = PDSCH_CRC_BITS;
        /*Coverity_Warning_Fix_Start*/
        if(mcsIndex < MAX_MCS_INDEX) 
        {
            itbsIndex = TBSArr[mcsIndex];
        }
        /*Coverity_Warning_Fix_End*/
        tbSize = TBSizeArrL2[itbsIndex][resourceBlockIndex];
        tbSize = MULTIPLY_BY_EIGHT(tbSize);

        if ((tbSize + PDSCH_CRC_BITS) > MAX_CODE_BLOCK_SIZE)
        {
            numOfCodeBlock = ceil_wrapper((tbSize+PDSCH_CRC_BITS)/\
                    (MAX_CODE_BLOCK_SIZE - PDSCH_CRC_BITS));
            crcBits = (numOfCodeBlock*PDSCH_CRC_BITS);
        }
        if(((tbSize + crcBits) <= maxNumberOfCodedBits) &&
                (tbSize <= maxBitsDLSCHTb))
        {
            if(tbSize > *maxTbSizeForRAT0_p)
            {
                *maxTbSizeForRAT0_p = tbSize;
                *maxMcsBelowCodeRateForRAT0_p = mcsIndex;
                *maxRBBelowCodeRateForRAT0_p = resourceBlockIndex;
            }
        }
        mcsIndex--;
    }while (mcsIndex >= 0);
}
/* 4x4 DL MIMO CHG END */

