/*****************************************************************************
 * Function Name  : calculateMaxMcsRbMapForRat0NonSpatialMultiplexFor4LayerNoLastRbg
 * Inputs         : rbCounter - number Of allocated Resource Blocks
 *                  cfiValueIndex - cfi Value,
 *                  masterMcsIndex - allocated Mcs,
 *                  maxNumberOfCodedBitsMap_p - Pointer to array which contains
 *                                              maximum Bits which can be coded 
 *                                              below max code rate value
 *                  tbOnLayer3or4,
 *                  rbIndexLeastMultipleOfRbgSize_p
 *                  internalCellIndex - Cell-Index at MAC
 * Outputs        : None
 * Returns        : None
 * Description    : This function will find the maximum possible MCS and allocated
 *                  RB values below Code Rate and for UE Category 5 in RAT0.
 *****************************************************************************/
void calculateMaxMcsRbMapForRat0NonSpatialMultiplexFor4LayerNoLastRBG(UInt8 rbCounter,
                             /* +- SPR 17777 */
                             UInt8 cfiValueIndex,
                             UInt8 masterMcsIndex,
                             UInt32 (*maxNumberOfCodedBitsMap_p)[MAX_MOD_SCHEME][MAX_NUM_OF_RB][MAX_NUM_OVERLAPPING_RB],
			     UInt8 tbOnLayer3or4,
			     UInt8 *rbIndexLeastMultipleOfRbgSize_p,
                 InternalCellIndex internalCellIndex )
{
    UInt8 rbgSize = (dlRAInfo_gp[internalCellIndex] + dlRAInfoIndex_g[internalCellIndex])->\
                    raPolicyInfo.rat0Info.rbgSize;
    UInt8 maxMcsForRAT0 = 0;
    UInt8 maxRBForRAT0 = 0;
    UInt8 maxMcsForRAT0ForLayer3 = 0;
    UInt8 maxRBForRAT0ForLayer3 = 0;
    UInt8 minRbThresholdValue = 0;
    UInt8 resourceBlockIndex=0;
    UInt8 sizeOfLastRbg = ( cellSpecificParams_g.cellConfigAndInitParams_p[internalCellIndex]->\
            cellParams_p->dlAvailableRBs % rbgSize);
    UInt8 rbDecrementFactor = 0;
    UInt8 initialRbDecrementFactor = 0;
    UInt32 maxBitsDLSCHTb = 0;
    UInt32 maxTbSizeForRAT0 = 0;
    McsRBInfoForNonSpatialMultiplex (*mcsRBInfo_p)[TB_ON_LAYER_3_OR_4][MCS_27_OR_28][MAX_NUM_OF_RB] = PNULL;
    McsRBInfoForNonSpatialMultiplex *mcsRBInfoForNonSpatialMultiplex_p = PNULL;
    McsRBInfoForNonSpatialMultiplex *tempmcsRBInfoForNonSpatialMultiplex_p = PNULL;
    DlUeCategoryInfo *dlUeCategoryInfo_p = 
                cellSpecificParams_g.cellConfigAndInitParams_p[internalCellIndex]->cellParams_p->dlUeCategoryInfo;
    resourceBlockIndex = rbCounter;
    minRbThresholdValue = rbCounter / LOWER_RB_THRESHOLD_FACTOR;
    minRbThresholdValue = rbCounter - minRbThresholdValue;
    mcsRBInfo_p =
        &(mcsRBMapForCodeRate4x4_g[cfiValueIndex].mcsRBTBSIzeInfoForNonSpatialMultiplex);
    if(0 ==((rbCounter + 1) % rbgSize))
    {
        initialRbDecrementFactor = 0;
    }
    else
    {
        initialRbDecrementFactor = 1;
    }
    maxBitsDLSCHTb = dlUeCategoryInfo_p[UE_CATEGORY_5 - 1].maxBitsDLSCHTb;
    if (tbOnLayer3or4)
    {
        if ((cfiValueIndex == 2) && (masterMcsIndex == 27))
            mcsRBInfoForNonSpatialMultiplex_p =  &((*mcsRBInfo_p)[LAYER_4_IDX_1]
                    [MCS_27_IDX_0][rbCounter]);/* For Layer 4 and MCS 27 */
        else
            mcsRBInfoForNonSpatialMultiplex_p =  &((*mcsRBInfo_p)[LAYER_4_IDX_1]
                    [MCS_28_IDX_1][rbCounter]);/* For Layer 4 and MCS 28 */
    }
    else
    {
        if ((cfiValueIndex == 2) && (masterMcsIndex == 27))
            mcsRBInfoForNonSpatialMultiplex_p =  &((*mcsRBInfo_p)[LAYER_3_IDX_0]
                    [MCS_27_IDX_0][rbCounter]);/* For Layer 3 and MCS 27 */
        else
            mcsRBInfoForNonSpatialMultiplex_p =  &((*mcsRBInfo_p)[LAYER_3_IDX_0]
                    [MCS_28_IDX_1][rbCounter]);/* For Layer 3 and MCS 28 */
    }
    rbDecrementFactor = initialRbDecrementFactor;
    resourceBlockIndex = rbCounter;
    maxMcsForRAT0 = 0;
    maxRBForRAT0  = 0;
    maxMcsForRAT0ForLayer3 = 0;
    maxRBForRAT0ForLayer3 = 0;
    maxTbSizeForRAT0 = 0;
    if(0 ==((rbCounter + 1) % rbgSize))
    {
        do
        {
            if(!tbOnLayer3or4) /* For Layer 3 TB1 will be small */
            {
                calculateBestCombinationMCSRB(masterMcsIndex,
                        resourceBlockIndex,
                        &maxMcsForRAT0ForLayer3,
                        &maxRBForRAT0ForLayer3,
                        &maxTbSizeForRAT0,
                        maxBitsDLSCHTb,
                        maxNumberOfCodedBitsMap_p);
            }
            maxTbSizeForRAT0 = 0;
            calculateBestCombinationMCSRBFor4LayerMimo(masterMcsIndex,
                    resourceBlockIndex,
                    &maxMcsForRAT0,
                    &maxRBForRAT0,
                    &maxTbSizeForRAT0,
                    maxBitsDLSCHTb,
                    maxNumberOfCodedBitsMap_p);

            if(resourceBlockIndex  >= rbgSize)
            {
                resourceBlockIndex = resourceBlockIndex - rbgSize;
            }
            else
            {
                resourceBlockIndex = 0;
            }

        }while(resourceBlockIndex > minRbThresholdValue);
        if(!tbOnLayer3or4) /* For Layer 3 and TB1*/
        {
            if ((maxMcsForRAT0 > maxMcsForRAT0ForLayer3) ||
                    (maxRBForRAT0 > maxRBForRAT0ForLayer3))
            {
                mcsRBInfoForNonSpatialMultiplex_p->mcsIndexForRat0 = 
                    maxMcsForRAT0ForLayer3;
                mcsRBInfoForNonSpatialMultiplex_p->numberOfresourceBlocksForRat0 =
                    (maxRBForRAT0ForLayer3 + 1);
            }
            else
            {
                mcsRBInfoForNonSpatialMultiplex_p->mcsIndexForRat0 = maxMcsForRAT0;
                mcsRBInfoForNonSpatialMultiplex_p->numberOfresourceBlocksForRat0 =
                    (maxRBForRAT0 + 1);
            }
        }
        else
        {
            mcsRBInfoForNonSpatialMultiplex_p->mcsIndexForRat0 = maxMcsForRAT0;
            mcsRBInfoForNonSpatialMultiplex_p->numberOfresourceBlocksForRat0 =
                (maxRBForRAT0 + 1);
        }
    }
    else
    {
        mcsRBInfo_p =
            &(mcsRBMapForCodeRate4x4_g[cfiValueIndex].mcsRBTBSIzeInfoForNonSpatialMultiplex);
        if (tbOnLayer3or4)
        {
            if ((cfiValueIndex == 2) && (masterMcsIndex == 27))
            {
                tempmcsRBInfoForNonSpatialMultiplex_p =
                    &((*mcsRBInfo_p)[LAYER_4_IDX_1][MCS_27_IDX_0]
                            [*rbIndexLeastMultipleOfRbgSize_p]);
                mcsRBInfoForNonSpatialMultiplex_p =
                    &((*mcsRBInfo_p)[LAYER_4_IDX_1][MCS_27_IDX_0][rbCounter]);
            }
            else
            {
                tempmcsRBInfoForNonSpatialMultiplex_p =
                    &((*mcsRBInfo_p)[LAYER_4_IDX_1][MCS_28_IDX_1]
                            [*rbIndexLeastMultipleOfRbgSize_p]);
                mcsRBInfoForNonSpatialMultiplex_p =
                    &((*mcsRBInfo_p)[LAYER_4_IDX_1][MCS_28_IDX_1][rbCounter]);
            }
        }
        else
        {
            if ((cfiValueIndex == 2) && (masterMcsIndex == 27))
            {
                tempmcsRBInfoForNonSpatialMultiplex_p =
                    &((*mcsRBInfo_p)[LAYER_3_IDX_0][MCS_27_IDX_0]
                            [*rbIndexLeastMultipleOfRbgSize_p]);
                mcsRBInfoForNonSpatialMultiplex_p =
                    &((*mcsRBInfo_p)[LAYER_3_IDX_0][MCS_27_IDX_0][rbCounter]);
            }
            else
            {
                tempmcsRBInfoForNonSpatialMultiplex_p =
                    &((*mcsRBInfo_p)[LAYER_3_IDX_0][MCS_28_IDX_1]
                            [*rbIndexLeastMultipleOfRbgSize_p]);
                mcsRBInfoForNonSpatialMultiplex_p =
                    &((*mcsRBInfo_p)[LAYER_3_IDX_0][MCS_28_IDX_1][rbCounter]);
            }
        }
        mcsRBInfoForNonSpatialMultiplex_p->mcsIndexForRat0 =
            tempmcsRBInfoForNonSpatialMultiplex_p->mcsIndexForRat0;
        mcsRBInfoForNonSpatialMultiplex_p->numberOfresourceBlocksForRat0 =
            tempmcsRBInfoForNonSpatialMultiplex_p->numberOfresourceBlocksForRat0;
    }
    if(0 != sizeOfLastRbg)
    {
        resourceBlockIndex = rbCounter;
        maxMcsForRAT0 = 0;
        maxRBForRAT0  = 0;
        maxMcsForRAT0ForLayer3 = 0;
        maxRBForRAT0ForLayer3 = 0;
        maxTbSizeForRAT0 = 0;
        do
        {
            if(!tbOnLayer3or4) /* For Layer 3 TB1 will be small */
            {
                calculateBestCombinationMCSRB(masterMcsIndex,
                        resourceBlockIndex,
                        &maxMcsForRAT0ForLayer3,
                        &maxRBForRAT0ForLayer3,
                        &maxTbSizeForRAT0,
                        maxBitsDLSCHTb,
                        maxNumberOfCodedBitsMap_p);
            }
            maxTbSizeForRAT0 = 0;
            calculateBestCombinationMCSRBFor4LayerMimo(masterMcsIndex,
                    resourceBlockIndex,
                    &maxMcsForRAT0,
                    &maxRBForRAT0,
                    &maxTbSizeForRAT0,
                    maxBitsDLSCHTb,
                    maxNumberOfCodedBitsMap_p);
            if(0 == rbDecrementFactor)
            {
                if(resourceBlockIndex >= (rbgSize - sizeOfLastRbg))
                {
                    resourceBlockIndex = (resourceBlockIndex - (rbgSize - sizeOfLastRbg));
                    rbDecrementFactor = 1;
                }
                else
                {
                    resourceBlockIndex = 0;
                }
            }
            else
            {
                if(resourceBlockIndex >= sizeOfLastRbg)
                {
                    resourceBlockIndex = (resourceBlockIndex - sizeOfLastRbg);
                    rbDecrementFactor = 0;
                }
                else
                {
                    resourceBlockIndex = 0;
                }
            }
        }while(resourceBlockIndex > minRbThresholdValue);
        if(!tbOnLayer3or4) /* For Layer 3 and TB1*/
        {
            if ((maxMcsForRAT0 > maxMcsForRAT0ForLayer3) ||
                    (maxRBForRAT0 > maxRBForRAT0ForLayer3))
            {
                mcsRBInfoForNonSpatialMultiplex_p->mcsIndexForRat0WithLastRBG =
                    maxMcsForRAT0ForLayer3;
                mcsRBInfoForNonSpatialMultiplex_p->numberOfresourceBlocksForRat0WithLastRBG =
                    (maxRBForRAT0ForLayer3 + 1);
            }
            else
            {
                mcsRBInfoForNonSpatialMultiplex_p->mcsIndexForRat0WithLastRBG =
                    maxMcsForRAT0;
                mcsRBInfoForNonSpatialMultiplex_p->numberOfresourceBlocksForRat0WithLastRBG =
                    (maxRBForRAT0 + 1);
            }
        }
        else
        {
            mcsRBInfoForNonSpatialMultiplex_p->mcsIndexForRat0WithLastRBG =
                maxMcsForRAT0;
            mcsRBInfoForNonSpatialMultiplex_p->numberOfresourceBlocksForRat0WithLastRBG =
                (maxRBForRAT0 + 1);
        }
    }
    if(tbOnLayer3or4)
        *rbIndexLeastMultipleOfRbgSize_p = rbCounter;
}

