/*****************************************************************************
 * Function Name  : calcMaxMcsRbInfoForRat1AndRat2SpatialMultiplexFor4Layer
 * Inputs         : rbCounter - number Of allocated Resource Blocks,
 *                  cfiValueIndex - cfi Value,
 *                  mcsIndexForTbOne - allocated Mcs for TB One,
 *                  mcsIndexForTbTwo - allocated Mcs for TB Two,
 *                  maxNumberOfCodedBitsMap_p - Pointer to array which contains
 *                                              maximum Bits which can be coded 
 *                                              below max code rate value,
 *                  tbOnLayer3or4
 *                  internalCellIndex - Cell-Index at MAC
 * Outputs        : None
 * Returns        : None
 * Description    : This function will find the maximum possible MCS for
 *                  TB One and TB Two and RB value below Code Rate
 *                  and for each UE Category in RAT1 and RAT2.
 *****************************************************************************/
void calcMaxMcsRbInfoForRat1AndRat2SpatialMultiplexFor4Layer(UInt8 rbCounter,
                             /* +- SPR 17777 */
                             UInt8 cfiValueIndex,
                             UInt8 mcsIndexForTbOne,
                             UInt8 mcsIndexForTbTwo,
                             UInt32 (*maxNumberOfCodedBitsMap_p)[MAX_MOD_SCHEME][MAX_NUM_OF_RB][MAX_NUM_OVERLAPPING_RB],
        UInt8 tbOnLayer3or4,
        InternalCellIndex internalCellIndex)
{
    UInt8 maxAllocatedRB = 0;
    UInt8 resourceBlockIndex = 0;
    UInt8 itbsIndex = 0;
    UInt8 minMcsValue = 0;
    UInt8 maxMcsValue = 0;
    UInt8 maxMcsForMinMcs = 0;
    UInt8 modScheme = 0;
    SInt8 mcsIndex = 0;
    UInt16 numOfCodeBlock = 0;
    UInt32 crcBitsForMaxTbSize = 0;
    UInt32 crcBits = 0;
    UInt32 tbSize = 0;
    UInt32 maxBitsDLSCHTb = 0;
    UInt32 maxTbSizeForMinMcs = 0;
    UInt32 maxNumberOfCodedBits = 0;
    McsRBInfoForNonSpatialMultiplex (*mcsRBInfo_p)[TB_ON_LAYER_3_OR_4][MCS_27_OR_28][MAX_NUM_OF_RB] = PNULL;
    McsRBInfoForNonSpatialMultiplex *mcsRBInfoForNonSpatialMultiplex_p = PNULL;
    McsRBInfoForSpatialMultiplex (*mcsRBInfoBase_p)[TB_ON_LAYER_3_OR_4][MCS_27_OR_28][MAX_MCS_INDEX][MAX_NUM_OF_RB] = PNULL;
    McsRBInfoForSpatialMultiplex *mcsRBInfoForSpatialMultiplex_p = PNULL;
    DlUeCategoryInfo *dlUeCategoryInfo_p = cellSpecificParams_g.\
                                           cellConfigAndInitParams_p[internalCellIndex]->cellParams_p->dlUeCategoryInfo;

    maxBitsDLSCHTb = dlUeCategoryInfo_p[UE_CATEGORY_5 - 1].maxBitsDLSCHTb;

    mcsRBInfo_p =
        &(mcsRBMapForCodeRate4x4_g[cfiValueIndex].mcsRBTBSIzeInfoForNonSpatialMultiplex);
    if(tbOnLayer3or4)
    {
        if((cfiValueIndex == 2) && (mcsIndexForTbOne == 27))
            mcsRBInfoForNonSpatialMultiplex_p =  &((*mcsRBInfo_p)[LAYER_4_IDX_1]
                    [MCS_27_IDX_0][rbCounter]);
        else
            mcsRBInfoForNonSpatialMultiplex_p =  &((*mcsRBInfo_p)[LAYER_4_IDX_1]
                    [MCS_28_IDX_1][rbCounter]);
    }
    else
    {
        if((cfiValueIndex == 2) && (mcsIndexForTbOne == 27))
            mcsRBInfoForNonSpatialMultiplex_p =  &((*mcsRBInfo_p)[LAYER_3_IDX_0]
                    [MCS_27_IDX_0][rbCounter]);
        else
            mcsRBInfoForNonSpatialMultiplex_p =  &((*mcsRBInfo_p)[LAYER_3_IDX_0]
                    [MCS_28_IDX_1][rbCounter]);
    }
    maxMcsValue = mcsRBInfoForNonSpatialMultiplex_p->mcsIndexForRat1AndRat2;
    maxAllocatedRB = mcsRBInfoForNonSpatialMultiplex_p->numberOfresourceBlocksForRat1AndRat2;
    if(maxAllocatedRB >= 1)
        maxAllocatedRB = maxAllocatedRB - 1;

    minMcsValue = mcsIndexForTbTwo;
    mcsIndex = mcsIndexForTbTwo;
    resourceBlockIndex = maxAllocatedRB;
    crcBits = PDSCH_CRC_BITS;
    do
    {
        /* Cyclomatic_complexity_changes_start */
        getModSchemeFromMcsIndex(mcsIndex, &modScheme);
        /* Cyclomatic_complexity_changes_end */

        maxNumberOfCodedBits = (*maxNumberOfCodedBitsMap_p)[(((modScheme)/QPSK) - 1)][resourceBlockIndex][0];
        maxNumberOfCodedBits = 2*maxNumberOfCodedBits;
        /*Coverity_Warning_Fix_Start*/
        if(mcsIndex < MAX_MCS_INDEX) 
        {
            itbsIndex = TBSArr[mcsIndex];
        }
        /*Coverity_Warning_Fix_End*/
        tbSize = TBSizeArrL2[itbsIndex][resourceBlockIndex];
        tbSize = MULTIPLY_BY_EIGHT(tbSize);
        if ((tbSize + PDSCH_CRC_BITS) > MAX_CODE_BLOCK_SIZE)
        {
            numOfCodeBlock = ceil_wrapper((tbSize+PDSCH_CRC_BITS)/\
                    (MAX_CODE_BLOCK_SIZE - PDSCH_CRC_BITS));
            crcBits = (numOfCodeBlock*PDSCH_CRC_BITS);
        }
        if(((tbSize + crcBits) <= maxNumberOfCodedBits) &&
                (tbSize <= maxBitsDLSCHTb))
        {
            if((tbSize + crcBits) > (maxTbSizeForMinMcs + crcBitsForMaxTbSize))
            {
                maxMcsForMinMcs = mcsIndex;
                break;
            }
        }
        mcsIndex--;
    }while (mcsIndex >= 0);

    minMcsValue =  maxMcsForMinMcs;
    mcsRBInfoBase_p =
        &(mcsRBMapForCodeRate4x4_g[cfiValueIndex].mcsRBTBSIzeInfoForSpatialMultiplex);
    if(tbOnLayer3or4)
    {
        if((cfiValueIndex == 2) && (mcsIndexForTbOne == 27))
            mcsRBInfoForSpatialMultiplex_p =  &((*mcsRBInfoBase_p)[LAYER_4_IDX_1][MCS_27_IDX_0]
                    [mcsIndexForTbTwo][rbCounter]);
        else
            mcsRBInfoForSpatialMultiplex_p =  &((*mcsRBInfoBase_p)[LAYER_4_IDX_1][MCS_28_IDX_1]
                    [mcsIndexForTbTwo][rbCounter]);
    }
    else
    {
        if((cfiValueIndex == 2) && (mcsIndexForTbOne == 27))
            mcsRBInfoForSpatialMultiplex_p =  &((*mcsRBInfoBase_p)[LAYER_3_IDX_0][MCS_27_IDX_0]
                    [mcsIndexForTbTwo][rbCounter]);
        else
            mcsRBInfoForSpatialMultiplex_p =  &((*mcsRBInfoBase_p)[LAYER_3_IDX_0][MCS_28_IDX_1]
                    [mcsIndexForTbTwo][rbCounter]);
    }
    mcsRBInfoForSpatialMultiplex_p->mcsIndexForTbOneRat1AndRat2 = maxMcsValue;
    mcsRBInfoForSpatialMultiplex_p->mcsIndexForTbTwoRat1AndRat2 = minMcsValue;
    mcsRBInfoForSpatialMultiplex_p->numberOfresourceBlocksForRat1AndRat2 = (maxAllocatedRB + 1);
}

