/****************************************************************************
* Function Name  : getModSchemeFromMcsIndex
* Inputs         : UInt8 mcs
*                  modType_p
* Outputs        : UInt8 modtypes
* Returns        : mode type
* Description    : This function returns mode scheme for the provided
*                  MCS.
****************************************************************************/
void getModSchemeFromMcsIndex(UInt8 mcs, UInt8 *modType_p)
{
    if(mcs <= MCS_INDEX_QPSK_9)
    {
        *modType_p = QPSK;
    }
    else if ((MCS_INDEX_16QAM_10 <= mcs) && (mcs <= MCS_INDEX_16QAM_16))
    {
        *modType_p = SIXTEENQAM;
    }
    /* + Coverity_27505_27504_27503_25390_25389 */
    else if (MCS_INDEX_64QAM_17 <= mcs)
    /* + Coverity_27505_27504_27503_25390_25389 */
    {
        *modType_p = SIXFOURQAM;
    }

    return;
}

/****************************************************************************
* Function Name  : getUlModSchemeFromMcsIndex
* Inputs         : UInt8 mcs
*                  modType_p
*                  enb64QAMFlag
*                  ueCategory
* Outputs        : UInt8 modtypes
* Returns        : mode type
* Description    : This function returns uplink mode scheme for the provided
*                  MCS .
****************************************************************************/
void getUlModSchemeFromMcsIndex(UInt8 mcs,
        UInt8 *modType_p,
        UInt8 enb64QAMFlag,
        UInt8 ueCategory)
{
    if(mcs<= UL_MCS_INDEX_QPSK_10)
    {
        *modType_p = QPSK;
    }
    else if ((UL_MCS_INDEX_16QAM_11 <=mcs) && (mcs<= UL_MCS_INDEX_16QAM_20))
    {
        *modType_p = SIXTEENQAM;
    }
    else if ((UL_MCS_INDEX_64QAM_21 <=mcs) && (mcs <= UL_MCS_INDEX_64QAM_28))
    {
        if((0 == enb64QAMFlag) || (ueCategory < 5))
        {
            *modType_p = SIXTEENQAM;
        }
        else
        {
            *modType_p = SIXFOURQAM;
        }
    }

    return;
}
